INSERT INTO `combos` VALUES (1,'Sloth’s and ATV ','This is a combination of adrenaline and conexion with the nature will begin  with  ATV it Will be a drive for about 4 hours by los Altos de Monterrey and la guaria area, we Will explore those awesome mountains between the rainforest also having the experience to swim in a river called Arenal, after this we continue at the Sloths territory with the sloths watching tour where we Will have the opportunity to observe animals like frogs, birds, monkeys but mainly our two species three toed and two toed sloths, learning a bit of how important is to preserve, protect and reforest our forest. This hike takes about 1.5 hours.\n',98,90,'[\"07:30:00\", \"11:00:00\"]','Transportation to the ATV\nFruits and water after the sloths tour.\nBilingual and certificated guides.\n','Insect repellen, umbrela or raincoat, hiking or tennis shoes.','combos/R5JbpvCUsqKgwcovo9SThbXHGXeKNj4mo551eMbq.png','76077c90-9161-417b-bc53-fdba6987e7e0','en','2021-12-16 20:56:07','2021-12-18 02:16:50'),(2,'Perezosos y Cuadraciclos','Este tour consiste en una combinación de adrenalina y conexión con la naturaleza, la primera actividad que se realiza sería el recorrido en los cuadraciclos de aproximadamente 4 horas, recorrerán diferentes relieves en el área de fortuna y los altos de Monterrey, por último, harán una parada en el río Arenal para refrescarse y en caso de querer nadar aprovechar el mismo.\n\nEl tour de perezosos consiste en una caminata por un bosque secundario lluvioso, el cual es recorrido el río la Habana, donde tendremos la oportunidad de observar animales como ranas, aves, monos, pero principalmente osos perezosos, también aprenderemos un poquito sobre la importancia de la protección y reforestación de nuestros bosques.',98,90,'[\"07:30:00\", \"11:00:00\"]','Transporte para el ATV.\nFrutas y agua en el recorrido de Territorio de Perezosos \nGuías bilingües y certificados para cada actividad.\n','Repelente, sombrilla o capa, ropa cómoda, tenis o zapatos para caminar.\nRopa extra para después de los cuadras.','combos/R5JbpvCUsqKgwcovo9SThbXHGXeKNj4mo551eMbq.png','76077c90-9161-417b-bc53-fdba6987e7e0','es','2021-12-16 20:56:07','2021-12-18 02:16:50'),(3,'Sloths & Zip Line','You can choose how you want to start your day with adrenaline or walking sorrounded by nature and peace.\n\nThe sloths watching tour where we Will have the opportunity to observe animals like frogs, birds, monkeys but mainly our two species three toed and two toed sloths, learning a bit of how important is to preserve, protect and reforest our forest. This hike takes about 1.5 hours.\n\nAfter this we will do the Zip line where we Will see the forest from top, watching how awesome is the tropical rainforest, running 7 cables where everyone has different elevations and distances, it will give us the chance to see 2 waterfalls La Fortuna and Pico blanco, this place has also a butterfly  garden, frog sanctuay and a small Maleku villa where we can be self guided.',88,79,'[\"08:00:00\", \"10:30:00\"]','Transportation to the canopy.\n\nFruits and water after the sloths tour.\n\nBIlingual guides.\n\n','Repelent, raincoat, tennis or hike shoes.','combos/m555arWNnIy9PY8dp2jx4j5lc2WR12AsAy5qSxDl.png','096a3373-6a65-489c-b2d8-c54a871e04a4','en','2021-12-16 21:41:43','2021-12-18 01:49:05'),(4,'Perezosos y Canopy ','En el recorrido del tour de perezosos tendremos la oportunidad de observar animales como ranas, aves, monos, pero principalmente osos perezosos, también aprenderemos un poquito sobre la importancia de la protección y reforestación de nuestros bosques. \n\nEl tour de canopy nos llevará a disfrutar desde un ángulo totalmente diferente las bellezas del bosque lluvioso, acá haremos un recorrido por 7 cables diferentes con elevaciones y distancias variadas, podremos disfrutar de la vista de 2 cataratas, Pico Blanco y La Fortuna, en este lugar también se tendrá la oportunidad de visitar un mariposario, ranario y una pequeña villa Maleku que tienen en su propiedad.\n\n',88,79,'[\"08:00:00\", \"10:30:00\"]','Transporte tour de Canopy. \n\nFrutas en el tour de perezosos y aguas.\n\nGuias bilingües y certificados.\n\n','Repelente, sombrilla o capa, ropa comoda, tennis o zapatos para caminar.','combos/m555arWNnIy9PY8dp2jx4j5lc2WR12AsAy5qSxDl.png','096a3373-6a65-489c-b2d8-c54a871e04a4','es','2021-12-16 21:41:43','2021-12-18 01:49:05'),(5,'Sloths and Whitewater Rafting 2&3','The day begin at 8:00am with the sloths watching tour where we Will have the opportunity to observe animals like frogs, birds, monkeys but mainly our two species three toed and two toed sloths, learning a bit of how important is to preserve, protect and reforest our forest. This hike takes about 1.5 hours.\nAfter this the Rafting company Will be picking you up to drive for 1 hour to the Balsa River where the adventure begin,you Will find rapids 2 and 3 classe, the rafting tour is for 2.5 on the river, at the middle of this activity you Will make a break to refresh you having some fruits and wáter after this you keep running the river until the end. Then once you be back in town you Will have a costarican typical lunch at their restaurant.',93,85,'[\"08:00:00\"]','Fruits, transportation at the rafting activity, lunch, wáter, guides and equipment needed!','Repellent, raincoat, running or tennis shoes.\nExtra clothes to change you at the end of the rafting.','combos/fbu4q56p9PKnVzlIX7HdzEOoyhZvxcI13xS8YiUZ.png','5b0ad285-11a9-448b-8614-e2c2a41a0c12','en','2021-12-17 07:41:08','2021-12-18 01:38:12'),(6,'Perezosos y Rafting Clase 2y3 ','Daríamos inicio a nuestro día a las 8:00 con el tour de perezosos donde tendremos la oportunidad de observar animales como ranas, aves, monos, pero principalmente osos perezosos, también aprenderemos un poquito sobre la importancia de la protección y reforestación de nuestros bosques. Continuando con el tour de rafting a las 9:50 pasaron por nosotros, el tour cuenta con rápidos nivel 2 y 3, este es un tour más aventurero y de mucha adrenalina, a mitad del tour realizaríamos una pequeña parada para tomar agua y comer una frutas, después de esto continuaríamos con el descenso sobre el río hasta culminar donde nos espera nuevamente el vehículo el cual nos llevara al lugar donde tendremos un delicioso almuerzo típico costarricense el cual consiste en un casado.',93,85,'[\"08:00:00\"]','Frutas, transporte para el rafting, almuerzo, aguas.\nGuias bilingües y certificados.','Repelente, sombrilla o capa, ropa comoda, tennis o zapatos para caminar.\nRopa de cambio para después del rafting o bien traje de baño para cuando lo hacen.','combos/fbu4q56p9PKnVzlIX7HdzEOoyhZvxcI13xS8YiUZ.png','5b0ad285-11a9-448b-8614-e2c2a41a0c12','es','2021-12-17 07:41:08','2021-12-18 01:50:56'),(7,'Sloths & Chocolate, coffee and Suggar Cane','You can choose how you want to start your day.\nThe sloths watching tour where we Will have the opportunity to observe animals like frogs, birds, monkeys but mainly our two species three toed and two toed sloths, learning a bit of how important is to preserve, protect and reforest our forest. This hike takes about 1.5 hours. \nWe combined the tour with the experience to taste and learn all about the coffee, chocolate & suggar cane, visiting a farm owned by a local and tradicional family from this región, they grow, colect and procees those fruits by their self.\nAt the end of the this activity you Will have the chance to taste chocolate, coffee and suggar cane.\n',68,59,'[\"08:00:00\", \"10:00:00\", \"11:00:00\", \"01:00:00\"]','Fruits after the Sloths tour, and water.','Repellent, comfortable clothes, closet shoes for both activities','combos/h6he7QkKUQQMUWNpfxx3MuNdImIjcSqwvWngfizq.png','fa792773-6884-41f5-ad0e-f38e8ae47ad3','en','2021-12-18 01:58:30','2021-12-18 01:58:30'),(8,'Perezosos y Chocolate, Café con Caña de Azucar','La visita al Territorio de perezosos es una experiencia para observarles en su habitad natural, se hará un recorrido de 1.5 horas, es un sendero muy accesible para todas las edades, la caminata es muy amena y perfecta para las familias y amantes a la naturaleza. Depués de este recorrido se dirigirían a Northfield Café donde sería la segunda actividad.\nEste tour es único en su área, el lugar pertenece a una humilde familia de la zona que ha decidido empezar su propio proyecto hace un tiempo, ellos tienen su propia plantación de café, chocolate y caña de azúcar acá se dará el recorrido el cual tarda aproximadamente 2.5 horas, también se tendrá degustaciones de chocolate, café y caña de azúcar.\n',68,59,'[\"08:00:00\", \"10:00:00\", \"11:00:00\", \"01:00:00\"]','Frutas, aguas en el primer tour. Chocolate, café y caña de azúcar en el segundo.','Repelente, sombrilla o capa, ropa comoda, tennis o zapatos para caminar.','combos/h6he7QkKUQQMUWNpfxx3MuNdImIjcSqwvWngfizq.png','fa792773-6884-41f5-ad0e-f38e8ae47ad3','es','2021-12-18 01:58:30','2021-12-18 01:58:30'),(9,'Sloths & Canyoning','You can choose how you want to start your day with adrenaline or sorrounded by nature and peace.\nThe sloths watching tour where we Will have the opportunity to observe animals like frogs, birds, monkeys but mainly our two species three toed and two toed sloths, learning a bit of how important is to preserve, protect and reforest our forest. This hike takes about 1.5 hours.\nThe canyoning has 5 rappels where the lowest one is about 20 mts and higgest is anout 55mts and one canopy line of 150 mts, enjoy this activity jumping, walking and rappeling this canyon located at el burrito Town, you Will be sorrounded by nature and adrenaline at the same time. After this drive to a local restaurant where you Will have the costarican typical Casado for lunch.\n\nThe rate per person is $108 without transportation or $118 per person with transportation. Kids from 11 to 7 years old $$102 without transportation or $112 per person with transportation\n',108,102,'[\"08:00:00\", \"11:00:00\"]','Lunch with Maquique, fruits after the Sloths tour, and water.','Extra clothes for after the canyon tour.\nRepellent, comfortable clothes, closet shoes for both activities\n','combos/0pdgjc6JkOHcuUc1B58v9C9nxrb7onqdhzHhCpL6.png','71be511f-cbd7-4cae-a958-05d0f05e31dd','en','2021-12-18 02:06:26','2021-12-18 02:26:12'),(10,'Perezosos & Cañonismo','En el tour de perezosos tendremos la oportunidad de observar animales como ranas, aves, monos, pero principalmente osos perezosos, también aprenderemos un poquito sobre la importancia de la protección y reforestación de nuestros bosques.  Continuando con el tour de cañón donde disfrutaremos del impresionante cañón del área del Burrito, el cual es recorrido por un pequeño rio y muchas cataratas donde tendremos la oportunidad de conectar con la naturaleza y experimentar mucha adrenalina. Haciendo descenso por 5 cataratas. Terminando nuestro recorrido en un canopy de 150 mts la cual nos dará retorno a la recepción del lugar.\nEl valor de la actividad es de $108 Sin transporte y $118 Con transporte por persona.\nNiños de 11 a 7 años $102 sin transporte y $112 con transporte.\n',108,102,'[\"08:00:00\", \"11:00:00\"]','Almuerzo, frutas, aguas','Repelente, sombrilla o capa, ropa comoda, tennis o zapatos para caminar.\nRopa de cambio para después del rafting o bien traje de baño para cuando lo hacen.\n','combos/0pdgjc6JkOHcuUc1B58v9C9nxrb7onqdhzHhCpL6.png','71be511f-cbd7-4cae-a958-05d0f05e31dd','es','2021-12-18 02:06:26','2021-12-18 02:26:12');
