INSERT INTO `mensajes_web` VALUES (2,'Leyden Hane','leydenh@hotmail.com','Hi!  I am trying to find out the price of tickets for the night walk tour on December 26th for a family of 4.  Thanks!','2021-08-03 01:01:04','2021-12-14 02:22:04','2021-12-14 02:22:04'),(3,'geovanny','geovanny032002@hotmail.com','Ofrecen tour el domingo?','2021-08-05 02:32:59','2021-12-14 02:22:11','2021-12-14 02:22:11'),(4,'Lori Shanks','lorishanks13@gmail.com','Hello \nI sent an email yesterday but I decided to send you a message as well. I would like to make a reservation for September 9th at 1:00 PM for 3 people. I do not want to get the APP WhatsAPP so how to I reserve a time/payment  Thanks','2021-08-17 17:53:39','2021-12-14 02:22:18','2021-12-14 02:22:18'),(5,'Denise Ellison Cerniglia','decern@gmail.com','Hi! I\'d like to book the 5am bird watching tour for 3 people on Friday September 10. Thank you!\n\nDenise Cerniglia','2021-08-28 20:25:46','2021-12-14 02:22:30','2021-12-14 02:22:30'),(6,'Silvia Noriega','lex799@gmail.com','Hi, We\'re visiting from San Diego, California, on Friday, October 15 and Saturday,16th, and would like to reserve a morning tour (8am to 10am) on either of those mornings.  We are a family of 5 (2 children+Grandmother).  Thank you.','2021-08-30 20:44:11','2021-12-14 02:22:36','2021-12-14 02:22:36'),(7,'Tami','tozsinay@gmail.com','Hello:)\nI would like to book the sloths observation tour for 8am tomorrow - we are 2 people. \nIs it possible?\nThank you!\nTami','2021-09-18 02:58:27','2021-12-14 02:23:49','2021-12-14 02:23:49'),(8,'Valeria Ardón Cervantes','valeria.ardon.c@gmail.com','Buenos días, quería saber los precios de los tours para nacionales y si el lugar es accesible para vehículos que no son tipo 4x4 o altos. Muchas gracias.','2021-09-22 20:40:43','2021-12-14 02:23:43','2021-12-14 02:23:43'),(9,'Ulises','uli.rp199@gmail.com','prueba','2021-09-24 06:16:21','2021-12-14 02:24:48','2021-12-14 02:24:48'),(10,'Yaelle','yaelle.bollinger@bluewin.ch','Hi! I will be staying at La Fortuna from the 14. to 17. of October and would love to book a tour with you guys to see sloths and other mammals. However, I don\'t have a car and wanted to ask how I could access the tours from my hotel? Thanks for your answer and have a nice day!','2021-10-04 19:42:46','2021-12-14 02:23:55','2021-12-14 02:23:55'),(11,'Salvador','salvatoremate@gmail.com','Buenos días! Estamos interesados en realizar el tour de perezosos hoy a las 15 horas. Hay posibilidad?','2021-10-04 23:44:10','2021-12-14 02:23:03','2021-12-14 02:23:03'),(12,'Matthew J Wilkerson','matthewjasonwilkerson@gmail.com','Was wanting to book a visit on October 14th.  For 1 adukt and 7yr old child. What are the prices?','2021-10-05 23:26:07','2021-12-14 02:23:08','2021-12-14 02:23:08'),(13,'Hadeel Khrais','hadeel.khrais@gmail.com','If we want a self-paced hike, how much are the tickets and do we need to book them in advance?','2021-10-06 19:24:34','2021-12-14 02:22:58','2021-12-14 02:22:58'),(14,'Aimee Lally','aimeelallyaz@gmail.com','Hola! Como hago una reservacion para Diciembre 28 para 4 adultos y una nina?','2021-10-12 23:42:33','2021-12-14 02:23:22','2021-12-14 02:23:22'),(15,'Chad Towler','chadtow@gmail.com','are you going to be offering morning tours on Christmas?','2021-10-22 04:33:39','2021-12-14 02:23:14','2021-12-14 02:23:14'),(16,'Sara','Sara@dornsife.com','Would like to reserve 2spots for the 1p tour today (Mon Oct 25).','2021-10-25 16:53:05','2021-12-14 02:24:16','2021-12-14 02:24:16'),(17,'samm shore','sammishore@gmail.com','Cuanto sale tour de dia ?','2021-10-28 02:22:46','2021-12-14 02:24:27','2021-12-14 02:24:27'),(18,'Jen','jennymac18@gmail.com','Hola! If I book all three of your tours, is there any special discount? I want to go on all of your tours, and my friends will probably join me on either the diurnal or night tour. :)','2021-11-01 05:25:47','2021-12-14 02:24:00','2021-12-14 02:24:00'),(19,'Dr. Florian Wieneke','florianwieneke@web.de','Hola, como estan?\nSomost 2 adultos y 1 nino de 7 anos, alemanes pero residentes de Colombia y tenemos previsto conocer a su precioso lugar posiblement el 6 de enero (por la tarde) para hacer 1o2 tour por la manana del 7 de enero. Quisiera saber si podriamos quedarnos la noche en nuestro camper en su territorio?\nagradezco de antemano su amable respuesta.\nun saludo cordial,\nFlorian','2021-11-02 01:53:01','2021-12-14 02:24:56','2021-12-14 02:24:56'),(20,'Christina','christina.millonigg@gmail.com','Hi, is it possible to just walk on my own, without a guide?','2021-11-05 01:19:34','2021-12-14 02:24:07','2021-12-14 02:24:07'),(21,'Judith Spaans','juudspaans@hotmail.com','Good day! We would love to visit your sloth territory on Tuesday, January 4. Can we make a reservation for the 10.00 DIURNAL OBSERVATION TOUR? We are with 3 persons. Best regards, Judith Spaans','2021-11-05 12:11:53','2021-12-14 02:24:36','2021-12-14 02:24:36'),(22,'Maren','maperobln@hotmail.com','Hello,\n\nhow much is a sloth Tour?\nBest regards\nMaren','2021-11-06 06:23:11','2021-12-14 02:24:41','2021-12-14 02:24:41'),(23,'Lindsey Drake','Lrobi014@gmail.com','Hi,\nDo you have a availability for a group of 4 this Wednesday?','2021-11-07 21:24:14','2021-12-14 02:25:04','2021-12-14 02:25:04'),(24,'Caleb May','may.caleb@gmail.com','Hola,\nWe are a party of 2 and we want to book a tour for today, November 8, for the sloth tour.\nI don’t have access to WhatsApp so I cannot book.\nDo you have any availability for today?\n\nGracias,\nCaleb','2021-11-08 18:53:44','2021-12-14 02:25:14','2021-12-14 02:25:14'),(25,'Alice Lim','alicej.lim@gmail.com','Hello, My partner and I would like to come to the 8-10 AM tour on Dec 10 Friday. How do we book?','2021-11-09 22:30:04','2021-12-14 02:25:23','2021-12-14 02:25:23'),(26,'Aubrey Yee','aubrey@pacific-contract.com','Hi! We would like to book for 1 adult and 2 kids (ages 7 and 10) on 11/22 at 10am. \n\nMy Whatʻs app is 1-808-216-8368\n\nAloha, Aubrey Yee','2021-11-13 23:27:05','2021-12-14 02:25:33','2021-12-14 02:25:33'),(27,'James','james-lamont@hotmail.co.uk','Hi, \nCan you just turn up or do you need to book in advance?\n\nThanks\n\nJames','2021-11-20 03:33:54','2021-12-14 02:25:44','2021-12-14 02:25:44'),(28,'Faith Kidd','faithkarisakidd@gmail.com','Hello,\nI would like to book the sloth tour for the morning of January 19. Is What\'s App the only way to book?','2021-11-20 20:40:26','2021-12-14 02:25:53','2021-12-14 02:25:53'),(29,'Wayne Crossan','joanne.crossan@virgin.net','Good morning ? \nPlease could we book Tuesday 28th December for 3pm observation tour.\nMany thanks, Joanne & wayne crossan','2021-11-21 13:59:40','2021-12-14 02:26:21','2021-12-14 02:26:21'),(30,'Ana Warman','ana@ldvillaghall.co.uk','Will you be open on January 1st 2022 for tours?','2021-11-23 01:18:35','2021-12-14 02:26:50','2021-12-14 02:26:50'),(31,'Barbara Manko','barbara_manko@yahoo.co.uk','Hello how much early morning tours?','2021-11-23 04:16:43','2021-12-14 02:26:41','2021-12-14 02:26:41'),(32,'Aimee Lally','aimeelallyaz@gmail.com','Hola! Tengo reservacion para 1 adulto y 4 ninos para el 28 de Diciembre a las 10 de la manana. Necesito anadir 1 adulto a nuestro grupo. Entonces seremos 2 adultos y 4 ninos. (edades 17,16,14 y 12)','2021-11-30 08:47:07','2021-12-14 02:26:35','2021-12-14 02:26:35'),(33,'CONTI Isabelle','contii@sfr.fr','Good evening,\nWe have discovered your park by Pierre of Tout Costa Rica.\n\nWe are two people and are interested in bird watching on monday 7th of march 2022 and a day tour the same day.\n\nWe have been told that there was a reduction 20% off with the premium Tout Costa Rica Card. What is the price for these tours with the reduction card.\n\nHow can we book?\n\nWith best regard,\nIsabelle Conti','2021-12-05 01:51:43','2021-12-14 02:20:45','2021-12-14 02:20:45'),(34,'Ulises','Ulises@gmail.com','Mensaje de prueba.','2021-12-05 04:16:30','2021-12-14 02:26:57','2021-12-14 02:26:57'),(35,'Valentyna Iyevlyeva','sysval@gmail.com','Hi!\n\nI\'d like to take the family (3 of us) on the tour on Monday, December 27th. Please let us know what is available. Thanks!','2021-12-06 04:54:25','2021-12-14 02:20:55','2021-12-14 02:20:55'),(36,'Dorota','jadwigakrolowa76@gmail.com','Hello, \nI would like to see a sloth free, what is the possibility that I will see them on your teritory?\nRegards\nDorota','2021-12-08 13:47:08','2021-12-14 02:21:39','2021-12-14 02:21:39'),(37,'Jasmine','jasmine.uryas@gmail.com','Hola, queria saber si el parque esta abierto todos los dias en Deciembre y si se necesita la prenotacion.\n\nSaludos,\nJasmine','2021-12-08 19:44:48','2021-12-14 02:21:30','2021-12-14 02:21:30'),(38,'Joy Israelson','joylars@mac.com','One person in our group can only walk short distances. Is there a way that she can return to the entrance and rest while the others continue the tour?','2021-12-09 23:26:18','2021-12-14 02:21:22','2021-12-14 02:21:22'),(39,'Petra Gleisenstein','p.gleisenstein@netcologne.de','Hi,\nwe are from 22. - 25. december in La Fortuna. Is it possible, just do come around or do we need a ticket in advance?\nBest wishes from germany\nPetra','2021-12-11 20:39:14','2021-12-14 02:21:15','2021-12-14 02:21:15'),(40,'Prueba','sloths.territory@gmail.com','Prueba','2021-12-12 02:09:10','2021-12-14 02:20:39','2021-12-14 02:20:39'),(41,'Rosa','rosamasis09@hotmail.com','Prueba','2021-12-12 02:11:01','2021-12-14 02:20:32','2021-12-14 02:20:32'),(42,'Betty Wu','bettywu1@gmail.com','Hello!\nWondering if you will be offering tours on the 22nd or 23rd?  Thank you!  Betty Wu','2021-12-13 22:53:32','2021-12-14 02:20:26','2021-12-14 02:20:26'),(43,'Brittaney O\'Toole','brittaneyross2@gmail.com','Hi, my husband and I would love to book a tour on January 2 at 1:00 if you have availability. \n\nBrittaney','2021-12-18 20:54:13','2021-12-18 23:53:31','2021-12-18 23:53:31'),(44,'Olena','olenavdatsenko@gmail.com','Hello, do you have any available guided tour for tomorrow (December 21) for 6 people?','2021-12-21 08:36:28','2021-12-22 19:58:54','2021-12-22 19:58:54'),(45,'Velvet A Dawson','velvetsmail@yahoo.com','Can I arrange a visit on the morning of 27 December 2021 for one adult, one teenager, and one child? Thank you!','2021-12-26 01:12:54','2021-12-26 01:58:39','2021-12-26 01:58:39'),(46,'SANCHEZ','kapler31@gmail.com','Hello, the day visit can be done with a guide who speaks French?\nCordially\nSylvain','2022-01-02 19:10:19','2022-01-03 20:22:17','2022-01-03 20:22:17'),(47,'Karen Sue Mally','ckmally@everestkc.net','how much does it cost for sloths territory','2022-01-03 08:19:27','2022-01-03 20:18:39','2022-01-03 20:18:39'),(48,'Kim Skaarup','Kim.Skaarup@gmail.com','We would like to book a DIURNAL OBSERVATION TOUR for two people on January 24, at 1PM.\n\nKind regards\nKim Skaarup\n+45 20144787','2022-01-08 18:35:47','2022-01-10 21:18:24','2022-01-10 21:18:24'),(49,'Ashley','Ashley.frear@yahoo.com','Hello! I had a wonderful night tour with you 2 nights ago. I have a question, I think my leg may have brushed up against a plant and now I have a red raw rash. I could send a picture if that helps? If you have any advice that would be much appreciated! Thank you !','2022-01-09 04:22:08','2022-01-10 20:32:54','2022-01-10 20:32:54'),(50,'Dwayne Dobson','connect@konzuk.com','Hi there! How far in advance should we realistically book a tour. We would hate to book something and not be able to make it for whatever reason. What is your cancelation policy?','2022-01-16 00:37:07','2022-02-01 07:15:37','2022-02-01 07:15:37'),(51,'Nicolas Baudouin','nicolas.baudouin@spglobal.com','hello, we were considering stepping by your beautiful territory but we have visible luggage in the car and would like to make sure that the parking is 100% safe or that luggage can be stored safely. Thanks Nicolas','2022-01-16 05:38:16','2022-02-01 07:15:26','2022-02-01 07:15:26'),(52,'Louis BESEME','louisbeseme@gmail.com','Hello.\nMy wife and I are planning to visit your Solth\'s territory on Monday the 31st of January 2022, is it mandatory to book the tour ?\nWe would like to do the DIURNAL OBSERVATION TOUR and we have the Premium ToutCostaRica card. \nThank you very much for your answer','2022-01-16 15:36:53','2022-02-01 07:15:15','2022-02-01 07:15:15'),(53,'Irene Moreno Denis','irenemordenis@gmail.com','A cuánto son las entradas','2022-01-17 20:05:12','2022-02-01 07:16:09','2022-02-01 07:16:09'),(54,'Ángel Tovar','tovar.angel@hotmail.com','Hola, quisiera reservar para 4 personas el 20 de enero el diurnal observatory tour a las 8h00 de la mañana.\nTengo la tarjeta premium Tour Costa Rica.\nCuál es el procedimiento.\nAtentamente,\n\nÁngel Tovar','2022-01-18 06:36:06','2022-02-27 22:10:54','2022-02-27 22:10:54'),(55,'Sarah Karafas','sarahkar00@gmail.com','Hi. What are your prices for the diurnal hike?','2022-01-19 17:49:06','2022-02-27 22:11:40','2022-02-27 22:11:40'),(56,'Sarah Karafas','sarahkar00@gmail.com','Hi. What are your prices for the diurnal hike?','2022-01-19 17:49:12','2022-02-27 22:11:59','2022-02-27 22:11:59'),(57,'Teresa lickerman','tess.art@mac.com','Hi. Can you tell me about he night hike vs the day tour? Would we still see sloths? Should we do both?  We are looking to book for the week of March 19th. Thank you','2022-01-22 02:25:44','2022-02-27 22:12:37','2022-02-27 22:12:37'),(58,'Teresa lickerman','tess.art@mac.com','Hi. Can you tell me about he night hike vs the day tour? Would we still see sloths? Should we do both?  We are looking to book for the week of March 19th. Thank you','2022-01-22 02:25:54','2022-02-27 22:37:24','2022-02-27 22:37:24'),(59,'Teresa lickerman','tess.art@mac.com','Hi. Can you tell me about he night hike vs the day tour? Would we still see sloths? Should we do both?  We are looking to book for the week of March 19th. Thank you','2022-01-22 02:25:59','2022-03-02 09:21:20','2022-03-02 09:21:20'),(60,'Tim Worms','timw@woodmax.net','I booked a tour through Trip Advisor but i did not get a confirmation,  Do you have a record of it?  It is for tomorrow, Sunday at 8 am','2022-01-23 08:16:58','2022-02-01 07:14:25','2022-02-01 07:14:25'),(61,'Tim Worms','timw@woodmax.net','I booked a tour through Trip Advisor but i did not get a confirmation,  Do you have a record of it?  It is for tomorrow, Sunday at 8 am','2022-01-23 08:16:59','2022-02-01 07:14:48','2022-02-01 07:14:48'),(62,'Luca Celentani Alvarez','luca.celentani@gmail.com','Hola! Estabamos interesados en contratar uno de los tours que ofrecéis, ¿cuáles son las principales diferencias entre el diurno y el nocturno? Como podemos reservar alguna de las actividades?\n\nUn saludoy buen finde!\n\nLuca','2022-01-23 15:37:19','2022-02-27 22:36:46','2022-02-27 22:36:46'),(63,'Emily','emily.jolliff@yahoo.com','We\'d like to book a tour but can\'t seem to do it through your website.  Can you tell me the prices and times of tours?','2022-01-24 06:55:50','2022-02-27 22:10:18','2022-02-27 22:10:18'),(64,'Jennifer Allen','jennallen.aia@gmail.com','Hello! I messaged through a Google chat link yesterday, but not sure you received the message. I booked for the wrong day yesterday. The confirmation # was 1245159106. I cancelled immediately and rebooked for today at 11am (1245162786). I was unable to receive a refund for the first booking through trip advisor. Is it possible to receive the refund for the first reservation? Thank you!','2022-01-24 18:46:44','2022-02-27 22:09:45','2022-02-27 22:09:45'),(65,'Jennifer Allen','jennallen.aia@gmail.com','Hello! I messaged through a Google chat link yesterday, but not sure you received the message. I booked for the wrong day yesterday. The confirmation # was 1245159106. I cancelled immediately and rebooked for today at 11am (1245162786). I was unable to receive a refund for the first booking through trip advisor. Is it possible to receive the refund for the first reservation? Thank you!','2022-01-24 18:46:48','2022-02-27 22:09:34','2022-02-27 22:09:34'),(66,'Bertrand FOURNIER','bertrand@fournier.link','Buenas noches\nI would be glad to attend a visit on the 29th in the morning (2 persons)\nRegards','2022-01-27 07:01:42','2022-02-01 07:11:45','2022-02-01 07:11:45'),(67,'Christopher B Rinker','cbrinker19.23@gmail.com','Hello, we do not have WhatsApp but we would like to book a diurnal tour for when we are there in March on our honeymoon. We will be there March 18-23, two adults. Thanks!','2022-01-27 07:11:31','2022-03-02 09:19:03','2022-03-02 09:19:03'),(68,'Julie Sierra','julierosesierra@yahoo.com','Hola! Seria posible hacer el tour de ver los perezosos el dia viernes 11 de febrero? somos 2 personas\ngracias\nJulie Sierra','2022-01-30 07:02:29','2022-02-27 22:05:25','2022-02-27 22:05:25'),(69,'Allison Klein','allison@allisonkleinhomes.com','What is the price for a tour to see the sloths during the day 3 adults 1 kid?\nThanks','2022-02-03 05:13:28','2022-02-27 22:05:03','2022-02-27 22:05:03'),(70,'Stephanie Martin','stephanievm1@gmail.com','Hello,\nWe are interested in a tour in early March. How far in advance should we book please? Do you see sloths at al the times offered?\nWhat does it cost? Thank you.','2022-02-06 23:14:45','2022-03-02 09:17:36','2022-03-02 09:17:36'),(71,'Tracey Conrad','jtconrad@bellsouth.ne','Hi,  I am interested in coming on Saturday to walk the trail.  Do you have any tour times open for 5?','2022-02-11 00:36:43','2022-02-27 22:03:50','2022-02-27 22:03:50'),(72,'Ulises','uli.rp1999@gmail.com','Prueba de mensajes','2022-02-12 06:09:21','2022-02-27 22:03:30','2022-02-27 22:03:30'),(73,'Maria Angeles','drarica9307@gmail.com','Is it OK Not to book ahead and just walk in on the day we want to do the tour?','2022-02-14 03:45:02','2022-02-27 22:04:34','2022-02-27 22:04:34'),(74,'Matthew Ungerleider','ungerlem@gmail.com','Hi Team! Do you have availability on the 1PM or 3PM tours for Saturday (2/19), Sunday (2/20) or Monday (2/21)? Also - wasn\'t able to see the price online for 2 people. What is cost? Thanks :) \nMatt','2022-02-14 08:38:54','2022-02-27 22:03:14','2022-02-27 22:03:14'),(