--
-- Table structure for table `reservas`
--

DROP TABLE IF EXISTS `reservas`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `reservas` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `id_agencia` bigint unsigned NOT NULL,
  `id_tour` bigint unsigned NOT NULL,
  `id_fecha_tour` bigint unsigned NOT NULL,
  `id_horario` bigint unsigned NOT NULL,
  `id_estado` bigint unsigned NOT NULL DEFAULT '1',
  `nombre_cliente` varchar(191) NOT NULL,
  `cantidad_adultos` int NOT NULL DEFAULT '0',
  `cantidad_niños` int NOT NULL DEFAULT '0',
  `cantidad_niños_gratis` int NOT NULL DEFAULT '0',
  `monto_total` decimal(8,2) NOT NULL,
  `descuento` decimal(8,2) NOT NULL DEFAULT '0.00',
  `monto_con_descuento` decimal(8,2) NOT NULL,
  `comision_agencia` decimal(8,2) NOT NULL,
  `monto_neto` decimal(8,2) NOT NULL,
  `factura` varchar(191) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `reservas_id_agencia_foreign` (`id_agencia`),
  KEY `reservas_id_horario_foreign` (`id_horario`),
  KEY `reservas_id_tour_foreign` (`id_tour`),
  KEY `reservas_id_fecha_tour_foreign` (`id_fecha_tour`),
  KEY `reservas_id_estado_foreign` (`id_estado`),
  KEY `idx_reservas_deleted_at` (`deleted_at`),
  CONSTRAINT `reservas_id_agencia_foreign` FOREIGN KEY (`id_agencia`) REFERENCES `agencias` (`id`),
  CONSTRAINT `reservas_id_estado_foreign` FOREIGN KEY (`id_estado`) REFERENCES `estados` (`id`),
  CONSTRAINT `reservas_id_fecha_tour_foreign` FOREIGN KEY (`id_fecha_tour`) REFERENCES `fecha_tour` (`id`),
  CONSTRAINT `reservas_id_horario_foreign` FOREIGN KEY (`id_horario`) REFERENCES `horarios` (`id`),
  CONSTRAINT `reservas_id_tour_foreign` FOREIGN KEY (`id_tour`) REFERENCES `tours` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3349 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

