y habitado por osos perezosos','es','810e137c-89d4-41cc-b889-706f6de7288b','2022-01-28 00:41:59','2022-01-28 00:41:59'),(69,'cards.card_1.titulo','REFORESTATION PROJECT-  OUR CONTRIBUTION TO INHERIT A BETTER PLANET','en','06f680b7-1f1c-4f7d-9e09-04d233963996','2022-01-28 00:41:59','2022-03-15 20:45:16'),(70,'cards.card_1.titulo','En Sloths Territory','es','06f680b7-1f1c-4f7d-9e09-04d233963996','2022-01-28 00:41:59','2022-01-28 00:41:59'),(71,'cards.card_2.titulo','SLOTH’S TERRITORY, THE HABITAT YOU HELP US TO PROTECT','en','3807b40d-cb86-450e-9905-9d9f1779180f','2022-01-28 00:41:59','2022-03-15 20:46:10'),(72,'cards.card_2.titulo','Podrás conocer','es','3807b40d-cb86-450e-9905-9d9f1779180f','2022-01-28 00:42:00','2022-01-28 00:42:00'),(73,'cards.card_3.titulo','Wonderful views','en','86b27f46-c61c-42e1-b160-b1041524016b','2022-01-28 00:42:00','2022-01-28 00:42:00'),(74,'cards.card_3.titulo','Maravillosas vistas','es','86b27f46-c61c-42e1-b160-b1041524016b','2022-01-28 00:42:00','2022-01-28 00:42:00'),(75,'cards.card_1.parrafo','It’s easy to plant a tree but much easier to cut them down… Hard is to take care of them, water them and conserve them to protect nature habitat. So we thank you to be here, since your visit support our conservancy project, you are part of this movement looking for a better planet for future generations… please spread the word and help us to grow!','en','43f1370a-9e51-4420-800b-11af988ae08e','2022-01-28 00:42:00','2022-03-15 20:45:42'),(76,'cards.card_1.parrafo','contamos con un gran hábitat natural','es','43f1370a-9e51-4420-800b-11af988ae08e','2022-01-28 00:42:00','2022-01-28 00:42:00'),(77,'cards.card_2.parrafo','Our project was born to protect the sloth’s habitat, since it’s habitat has been seriously affected by deforestation and the main reason why Costa Rica declared this animal as National Symbol.\r\nOur goal is to spread knowledge by educating  people and show them the importance of every single specie in our fragile ecosystem.','en','