2','La duración de esta actividad es de 2 horas','es','9cec9601-4c23-467c-a756-265dd80cb8df','2022-01-28 00:42:01','2022-01-28 00:42:01'),(111,'service.tour_diurno.info.titulo_principal','DIURNAL OBSERVATION TOUR','en','426e9213-7c84-4a97-92fc-3e5d246303d9','2022-01-28 00:42:01','2022-01-28 00:42:01'),(112,'service.tour_diurno.info.titulo_principal','TOUR DIURNO','es','426e9213-7c84-4a97-92fc-3e5d246303d9','2022-01-28 00:42:01','2022-01-28 00:42:01'),(113,'service.tour_diurno.info.titulo_secundario_1','Information about the diurnal observation tour','en','f0fac0f7-860c-409b-bd3a-917dd2195b7e','2022-01-28 00:42:01','2022-01-28 00:42:01'),(114,'service.tour_diurno.info.titulo_secundario_1','Información sobre el tour diurno','es','f0fac0f7-860c-409b-bd3a-917dd2195b7e','2022-01-28 00:42:01','2022-01-28 00:42:01'),(115,'service.tour_diurno.info.parrafo_1','We offer several daily hikes starting at: 8am - 10am - 1pm and 3pm','en','28da276e-c2ec-4c0b-a6f3-94bb1cfbec2a','2022-01-28 00:42:01','2022-01-28 00:42:01'),(116,'service.tour_diurno.info.parrafo_1','Ofrecemos varias caminatas diarias iniciando a las: 8 a.m. - 10 a.m. - 1 p.m. y 3 p.m.','es','28da276e-c2ec-4c0b-a6f3-94bb1cfbec2a','2022-01-28 00:42:01','2022-01-28 00:42:01'),(117,'service.tour_diurno.info.parrafo_2','During the hike, the trail allows you to enjoy a gallery forest with lush vegetation and giant trees as Chilamate and Guácimo Colorado; constituting the habitat of many species like: opossums, two and three toed-sloths and many birds such as toucans, tanagers, Royal Flycatchers and others. But the main attraction is the sloth\'s observation.','en','ddc21583-4883-4003-b54a-73e751f43f84','2022-01-28 00:42:01','2022-01-28 00:42:01'),(118,'service.tour_diurno.info.parrafo_2','Durante la caminata, el sendero le permitirá disfrutar de un bosque de galería con exuberante vegetación y árboles gigantes como Chilamate y Guácimo Colorado; constituyendo el hábitat de muchas especies como: zarigüeyas, perezosos de dos y tres dedos y muchas aves como: Tucanes, Tangaras, Royal Flycatchers y otras. Pero el principal atractivo es la observación de los osos perezosos.','es','ddc21583-4883-4003-b54a-73e751f43f84','2022-01-28 00:42:01','2022-01-28 00:42:01'),(119,'service.tour_diurno.info.parrafo_3','The Rodriguez Family, a traditional Costa Rican family will be your guides, since trying to find sloths require high skills because they use to have an  excellent camouflage that make them imperceptible, for not trained eyes. The trail is accessible for all ages, so this is an activity where the whole family can enjoy it.','en','d114e6ca-6372-4762-b39b-80c9d89b1472','2022-01-28 00:42:01','2022-01-28 00:42:01'),(120,'service.tour_diurno.info.parrafo_3','La Familia Rodríguez, una familia tradicional costarricense serán sus guías, ya que tratar de encontrar perezosos requiere de altas habilidades porque suelen tener un excelente camuflaje que los hace imperceptibles, para ojos no entrenados.','es','d114e6ca-6372-4762-b39b-80c9d89b1472','2022-01-28 00:42:01','2022-01-28 00:42:01'),(121,'service.tour_diurno.info.parrafo_4','The trail is accessible for all ages, so this is an activity where the whole family can enjoy it.','en','3e1b7c90-bfee-48e9-8924-d4d0fcd5eb4e','2022-01-28 00:42:01','2022-01-28 00:42:01'),(122,'service.tour_diurno.info.parrafo_4','El sendero es accesible para todas las edades, por lo que esta es una actividad donde toda la familia puede disfrutarla.','es','3e1b7c90-bfee-48e9-8924-d4d0fcd5eb4e','2022-01-28 00:42:01','2022-01-28 00:42:01'),(123,'service.tour_diurno.info.parrafo_5','The tour includes a trained guide during the whole hike with professional telescope and fresh seasonal fruits snack at the end.','en','67ec5179-126a-423a-abd3-9e3f4449dc80','2022-01-28 00:42:01','2022-01-28 00:42:01'),(124,'service.tour_diurno.info.parrafo_5','El recorrido incluye un guía capacitado durante toda la caminata con un telescopio profesional y un refrigerio de frutas frescas de temporada al final.','es','67ec5179-126a-423a-abd3-9e3f4449dc80','2022-01-28 00:42:01','2022-01-28 00:42:01'),(125,'service.tour_diurno.info.parrafo_6','The duration of this activity can be from 1 and a half to 2 hours and the price is US$28 per person; Children from 5 to 11 y/o US$17 and younger than 5 y/o are free.','en','1712a0fc-21a0-48a5-b8b8-069887adf453','2022-01-28 00:42:01','2022-02-27 21:52:08'),(126,'service.tour_diurno.info.parrafo_6','La duración de esta actividad puede ser de 1 hora y media a 2 horas y el precio es de US $ 28 por persona; Niños de 5 a 11 años US $ 17 y menores de 5 años entran gratis.','es','1712a0fc-21a0-48a5-b8b8-069887adf453','2022-01-28 00:42:01','2022-02-27 21:52:08'),(127,'service.tour_nocturno.info.titulo_principal','NIGHT HIKE EXPERIENCE','en','555ff1c7-8aae-49cf-8a99-20509790fe63','2022-01-28 00:42:01','2022-01-28 00:42:01'),(128,'service.tour_nocturno.info.titulo_principal','TOUR NOCTURNO','es','555ff1c7-8aae-49cf-8a99-20509790fe63','2022-01-28 00:42:01','2022-01-28 00:42:01'),(129,'service.tour_nocturno.info.titulo_secundario_1','Information about the night hike','en','122cb0a5-741b-4636-b748-90c1a2d1275c','2022-01-28 00:42:01','2022-01-28 00:42:01'),(130,'service.tour_nocturno.info.titulo_secundario_1','Información sobre el tour nocturno','es','122cb0a5-741b-4636-b748-90c1a2d1275c','2022-01-28 00:42:01','2022-01-28 00:42:01'),(131,'service.tour_nocturno.info.parrafo_1','Our night hike starts at 6:00pm, the best time to look for animals with nocturnal behavior.','en','d835e349-b91c-4b7a-ae4e-b95c6ceaaecd','2022-01-28 00:42:01','2022-01-28 00:42:01'),(132,'service.tour_nocturno.info.parrafo_1','Nuestra caminata nocturna inicia a las 6:00 pm, el mejor momento para buscar animales con comportamiento nocturno.','es','d835e349-b91c-4b7a-ae4e-b95c6ceaaecd','2022-01-28 00:42:01','2022-01-28 00:42:01'),(133,'service.tour_nocturno.info.parrafo_2','During this hike, you will have the chance to see different kind of frogs, kinkajous, snakes, spiders, bats and eventually: two and three-toed sloths (but it is not the focus of this specific hike).','en','3d704a4d-4070-4f79-bd97-7041378237f2','2022-01-28 00:42:01','2022-01-28 00:42:01'),(134,'service.tour_nocturno.info.parrafo_2','Durante esta caminata, tendrá la oportunidad de ver diferentes tipos de ranas, kinkajous, serpientes, arañas, murciélagos y eventualmente: perezosos de dos y tres dedos (pero no es el enfoque de esta caminata específica).','es','3d704a4d-4070-4f79-bd97-7041378237f2','2022-01-28 00:42:01','2022-01-28 00:42:01'),(135,'service.tour_nocturno.info.parrafo_3','While the night starts and the sky gets full of stars, our well-trained guide will keep you safe while you continue the hike through our property.','en','021fbafa-7fb3-4f39-8de0-65268f10f4bb','2022-01-28 00:42:01','2022-01-28 00:42:01'),(136,'service.tour_nocturno.info.parrafo_3','Mientras la noche da su iniciao y el cielo se cubre de estrellas, nuestro guía bien capacitado lo mantendrá seguro, mientras continúa la caminata a lo largo de nuestra propiedad.','es','021fbafa-7fb3-4f39-8de0-65268f10f4bb','2022-01-28 00:42:01','2022-01-28 00:42:01'),(137,'service.tour_nocturno.info.parrafo_4','The trail is accessible for all ages, so this is an activity where the whole family can enjoy it.','en','0a07e0e3-1510-4ebf-941b-e0cf88913ae1','2022-01-28 00:42:01','2022-01-28 00:42:01'),(138,'service.tour_nocturno.info.parrafo_4','El sendero es accesible para todas las edades, por lo que esta es una actividad donde toda la familia puede disfrutarla.','es','0a07e0e3-1510-4ebf-941b-e0cf88913ae1','2022-01-28 00:42:01','2022-01-28 00:42:01'),(139,'service.tour_nocturno.info.parrafo_5','The duration of this activity is 1 and a half to 2 hours. The price is US$60 per person; children from 6 to 12 years US$35.','en','4b218201-8f1a-427e-869a-386644c2270c','2022-01-28 00:42:01','2022-01-28 00:42:01'),(140,'service.tour_nocturno.info.parrafo_5','La duración de esta actividad es de 1 hora y media a 2 horas. E