		INNER JOIN horarios H ON H.id = R.id_horario
		INNER JOIN estados E ON E.id = R.id_estado
		WHERE	
			A.nombre = agencia AND R.deleted_at IS NULL
		ORDER BY 
			E.nombre DESC,
			F.fecha ASC,
            H.orden ASC;
            
